import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './App.css';
import {
  Card,
  Button,
  CardImg,
  CardTitle,
  CardText,
  CardBody,
  Container,
  Row,
  Col
} from 'reactstrap';
import Header from './navbar';
import Movies from './movie';

class App extends Component {
  render() {

      return (
            < div className = "App" >

             <Header/>

             < Container >
             <Row>
             <Movies/>
             </Row>
             </Container>
            </div>
        );
    }
}


export default App;
